import React from 'react';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { StyleSheet } from 'react-native';

import AppRotes from './stack.routes';

import Home from '../pages/Home';
import settingsScreen from '../components/settingsScreen';
import historico from '../components/historico';

export const Tab = createBottomTabNavigator();
 const TabNavi = () => {
    return (
  <Tab.Navigator>
    <Tab.Screen name="Modelo1/2" component={AppRotes} style={styles.container}/>
    <Tab.Screen name="Settings" component={settingsScreen} style={styles.container}/>
    <Tab.Screen name="HistÃ³rico" component={historico} style={styles.container}/>
  </Tab.Navigator>
  )
};

const styles = StyleSheet.create({
	container: {
		flex: 1,
		justifyContent: 'center',
		alignItems: 'center',

	},
});

export default TabNavi;
